INSERT INTO `socialmedia_links` (`socialMedia_id`, `socialMedia_name`, `socialMedia_title`, `socialMedia_link`, `socialMedia_post`, `socialMedia_status`) VALUES
(1, 'youtube', '2023 MANILA RESEARCH CONGRESS', 'https://www.youtube.com/@depedmanilaYT/featured', 'https://www.youtube.com/embed/rt0Uss9GLlc', 'active'),
(2, 'facebook', 'PUBLIC SCHOOLS DISTRICT SUPERVISORS CONVENE IN BOHOL FOR THE 3RD GROUNDBREAKING CONVENTION \nTagbilaran City, Bohol - February 7, 2024\nJUST IN: The 3rd National Research Convention for Public Schools District Supervisors is in full swing in Tagbilaran City, Bohol, with Public Schools District Supervisors from across the Philippines gathering to address the theme \"Convergence to Emerging Global and Regional Educational Trends: Responding to the Challenges of a Resilient Educational System.\" Held from February 6 to 8, 2024, the convention serves as a pivotal platform for educators to exchange insights and innovations crucial for navigating the evolving educational landscape.\nAmong the notable presenters representing the Schools Division Office (SDO) of Manila are Dr. Roniko Natividad and Dr. Ronald Vincent Salva. Dr. Natividad\'s research, titled \"Pedagogical Transitions Experienced by Selected Elementary School Teachers in the Post-Pandemic: Inputs for Effective Curriculum Practice,\" sheds light on the adaptations made by elementary educators in the wake of the COVID-19 pandemic, offering invaluable contributions to curriculum development. Dr. Salva\'s study, \"Cognitive Foundation of Reading: An Analysis in Utilizing the Bottom-Up Technique - The 3BS Manilenyo Approach (Modified ABAKADA),\" explores innovative methods to enhance reading skills among students, showcasing the dedication of educators to meet the diverse needs of learners in a rapidly changing world.             \nCongratulations Dr. Salva and Dr. Natividad! SDO Manila is truly proud of you!', 'https://www.facebook.com/DepEdManilaOfficial/', 'https://www.facebook.com/DepEdManilaOfficial/posts/pfbid06dC4ZA4LzaHRSpYrZxUxmzokgT6vNXSPxmfFtkj3gBK4gpwkofmLHXdEH4ubJM4il', 'active'),
(3, 'facebook', 'SDO MANILA SUPERVISORS PLAY PIVOTAL ROLE IN VALIDATING NCR’S  MATATAG LEARNING RESOURCES\nHAPPENING NOW: Manila, Philippines - January 29, 2024\nIn a significant development, the Department of Education National Capital Region (DepEd NCR) has chosen Education Program Supervisors from the SDO Manila to play a vital role as validators for the MATATAG Learning Resources designed for Quarter 1 of the upcoming School Year 2024-2025. The esteemed group of supervisors includes Ms. Merie Gerlie V. Capiral, Mr. Conrado S. Contreras, Ms. Amcy M. Esteban, Dr. Lucita A. Gener, Dr. Edwin R. Mabilin, Ms. Amalia C. Solis, Dr. Remylinda T. Soriano, Dr. Ariel D. Tosio, Mr. Vicente M. Victorio, Jr., and Dr. Lucky S. Carpio. The validation process is a crucial component of the ongoing Workshop on the Review, Revision, and Finalization of Quarter 1 Learning Resources for the MATATAG Curriculum Implementation (1st Leg), which commences today, January 29 to February 2, 2024, at the prestigious Axiaa Hotel in Manila, Quezon City.\nSpearheaded by DepEd NCR\'s Curriculum and Learning Management Division, under the helm of OIC Ms. Micah Pacheco and graced by NCR Director Jocelyn Andaya, the workshop has gathered key participants not only from SDO Manila but also from other NCR Divisions, underscoring a collaborative approach to curriculum development. The Education Program Supervisors, known for their expertise and experience, have been entrusted with the responsibility of ensuring the excellence and relevance of the learning resources that will define the educational landscape in the upcoming academic year.\nAs the first leg of the MATATAG Curriculum Implementation progresses, the involvement of SDO Manila Education Program Supervisors as editors and validators adds a layer of precision and insight to the process. This initiative reflects the commitment of education stakeholders to delivering a resilient curriculum that prepares students for the challenges and opportunities of the future, marking a pivotal moment in the ongoing evolution of Philippine education. Stay tuned for updates on the outcomes of this collaborative effort, set to shape the future of education in the nation\'s capital.', 'https://www.facebook.com/DepEdManilaOfficial/', 'https://www.facebook.com/DepEdManilaOfficial/posts/pfbid0c9AAxXvyy5pvJGD9o6YEE5bgX9uDFGSEcTYV6zkduRAhZHvmPhAi1iMjazUDPwWUl', 'active'),
(4, 'facebook', 'EDUCATION LEADERSHIP in ACTION: NCR JOINS HISTORIC \'BAGONG PILIPINAS\' LAUNCH\nManila, January 28, 2024 \nThe Department of Education led by VP Secretary Sara Z. Duterte, together with the delegation from the National Capital Region headed by Director Jocelyn DR Andaya and ARD Cristito Eco, alongside the 16 divisions Superintendents and Elementary School Principals, actively participated in the monumental launch of Bagong Pilipinas on January 28 at the Quirino Grandstand.\nSuperintendent Rita E. Riddle, steering the School Division Office (SDO) Manila, played a crucial role by deploying 20 ushers and 16 nurses to guide the DepEd delegation amidst the thousands of diverse audience from government agencies, universities, and the general public. This collaborative effort signifies a significant stride towards a new era in Philippine governance.\n#DepEd #Manila #MATATAG #BagongPilipinas', 'https://www.facebook.com/DepEdManilaOfficial/', 'https://www.facebook.com/DepEdManilaOfficial/posts/pfbid0HrQCLnYvsYC2SCPWnYFCg24HYT4jgnqaadk5e97P1KcqY4mYsRax1M2FhTNWmqzUl', 'active'),
(5, 'facebook', 'ADVISORY\nAugust 3, 2023 — The Department of Education (DepEd) announces that the opening of classes for School Year 2023-2024 in all public schools will be on August 29, 2023.\nPrivate schools may choose to open classes on any date starting “the first Monday of June but not later than the last day of August,\" pursuant to Republic Act 11480.\nThank you.', 'https://www.facebook.com/DepEdManilaOfficial/', 'https://www.facebook.com/DepEdManilaOfficial/posts/1037746440456974:1037746440456974', 'inactive');
